// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/proxy/utils/UUPSUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/math/SafeMathUpgradeable.sol";

contract Dmeet is Initializable, OwnableUpgradeable, UUPSUpgradeable {
    using SafeMathUpgradeable for uint256;

    event Membership(address indexed creator, uint256 viewer, uint256 participant);

    uint256 private _currentTokenID;

    mapping (uint256 => address) public creators;
    mapping (uint256 => uint256) public tokenPrice;
    mapping(uint256 => mapping(address => uint256)) private _balances;

    modifier creatorOnly(uint256 _id) {
        require(creators[_id] == msg.sender, "ONLY_CREATOR_ALLOWED");
        _;
    }

    function initialize(
    ) initializer public {
        __Ownable_init();
        __UUPSUpgradeable_init();
    }

    function buyMembership(uint256 _id)
        public
        payable
    {
        require(_exists(_id), "NONEXISTENT_TOKEN");

        uint256 amount = balanceOf(msg.sender, _id);
        require(amount < 1, "already have");

        uint256 price = tokenPrice[_id];
        require(price <= msg.value, "insuffient amount");

        address creator = creators[_id];

        (bool sent, /* bytes memory data */) = creator.call{value: msg.value.div(1000).mul(900)}("");
        require(sent, "Failed to send Ether");

        _balances[_id][msg.sender] = 1;
    }

    function createMembership(uint256 _viewerPrice, uint256 _participantPrice) external {
        uint256 viewer = 0;
        uint256 participant = 0;

        if (_viewerPrice > 0) {
            viewer = _getNextTokenID();
            _incrementTokenTypeId();

            creators[viewer] = msg.sender;
            tokenPrice[viewer] = _viewerPrice;
            _balances[viewer][msg.sender] = 1;
        }

        if (_participantPrice > 0) {
            participant = _getNextTokenID();
            _incrementTokenTypeId();

            creators[participant] = msg.sender;
            tokenPrice[participant] = _participantPrice;
            _balances[participant][msg.sender] = 1;
        }

        emit Membership(msg.sender, viewer, participant);
    }

    function balanceOf(address _account, uint256 _id) public view returns (uint256) {
        require(_account != address(0), "address zero is not a valid owner");
        require(_exists(_id), "NONEXISTENT_TOKEN");

        return _balances[_id][_account];
    }

    function withdraw() public onlyOwner {
        uint balance = address(this).balance;

        (bool sent, /* bytes memory data */) = msg.sender.call{value: balance}("");
        require(sent, "Failed to send Ether");
    }

    function _authorizeUpgrade(address newImplementation)
        internal
        onlyOwner
        override
    {}

    function _exists(
        uint256 _id
    ) internal view returns (bool) {
        return creators[_id] != address(0);
    }

    function _getNextTokenID() private view returns (uint256) {
        return _currentTokenID.add(1);
    }

    function _incrementTokenTypeId() private {
        _currentTokenID++;
    }
}
